import React, { Component } from 'react'

export default class App extends Component {
  constructor(){
    super()
    this.state ={
      name : "",
      pass:""
    }
  }
  render() {
    return (
      <div>
        <h1>Controlled Component</h1>
        <input value={this.state.name} onChange={(event)=>{this.setState({name:event.target.value})}} type="text" placeholder='Enter your Name' /><br /><br />
        <input value={this.state.pass} onChange={(event)=>{this.setState({pass:event.target.value})}} type="password" placeholder='enter your passwprd' /><br /><br />
        <button onClick={()=>{this.submit}}>Submit</button>
      </div>
    )
  }
}
